import React, {Fragment} from 'react';

const Card =(props) => {
	const {name, email, id} = props;
	return(
		<Fragment>
			<div className='dt-row-m tc bg-dark-green dib br4 pa1 ma2 grow shadow-5'> 
				<img src={`https://robohash.org/${id}?200x200`}/>    
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</Fragment>
	);
}

export default Card;
